import React, { useEffect } from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import Analytics from "../components/features/analytics/Analytics";
// import Meta from "./helpers/meta";
import SetTitles from "../helpers/SetTitles";

import Home from "./home";
import Login from "./login";
import Register from "./register";
import confirmationCode from "./confirmationCode";
import UserData from "./userData";
import ForgotPassword from "./forgotPassword";
import newPassword from "./newPassword";
import Profile from "./profile";
import AboutUs from "./aboutUs";
import EventDetail from "./eventDetail"; 
import Logout from "./Logout";

//temp
import { useDispatch } from "react-redux";
import { Auth, API } from "aws-amplify";
import { setUserData } from "../store/actions/user.action";
import config from "../config/constants";

const Routes = () => {

  const dispatch = useDispatch()
  const get_user_data = (cognito_response) => {
      const user_id = cognito_response.attributes.sub;

      API.get(config.APIS.SOMLIVRE, `usuario/${user_id}`, {})
      .then(response => {
          console.log("get user data bem sucedido. Response: ", response);
          dispatch(setUserData(response.data));
      })
      .catch(error => {
          console.log("get user data falhou: ", error);
      });
  }

  const get_authenticated_user = () => {
  Auth.currentAuthenticatedUser()
      .then(response => {
      console.log("get_authenticated_user, response:", response);
      get_user_data(response);
      })
      .catch(error => {
      console.log(error)
      });
  }

  useEffect(() => {
    get_authenticated_user()
  // eslint-disable-next-line
  },[])

  return (
    <BrowserRouter>
      <Analytics />
      <SetTitles />
      {/* <Meta /> */}
        <main>
          <Switch>
            <Route path="/" exact component={ Home } />
            <Route path="/login" component={ Login } />
            <Route path="/cadastro" component={ Register } />
            <Route path="/codconfirmacao" component={ confirmationCode } />
            <Route path="/seusdados" component={ UserData } />
            <Route path="/esquecisenha" component={ ForgotPassword } />
            <Route path="/novasenha" component={ newPassword } />
            <Route path="/perfil" component={ Profile } />
            <Route path="/quemsomos" component={ AboutUs } />
            <Route path="/eventos" component={ EventDetail } />
            <Route path="/logout" component={Logout} />
          </Switch>
        </main> 
    </BrowserRouter>
  );
};

export default Routes;
